export default {

	activeJobResponse: () => {
		if (GetJobOrderJobResponses.data == null) {
			return ""
		}
		if (GetJobOrderJobResponses.data.data.getJobOrder.jobResponses == null) {
			return ""
		}
		for (let i = 0; i < GetJobOrderJobResponses.data.data.getJobOrder.jobResponses.length; i++) {
			let line = GetJobOrderJobResponses.data.data.getJobOrder.jobResponses[0]
			if (line.materialActual != null) {
				for (let j = 0; j < line.materialActual.length; j ++) {
					if (line.materialActual[j].carrier != null) {
						if (line.materialActual[j].carrier.code == selectReportCarrier.selectedOptionLabel) {
							return line.id
						}
					}
				}
			} else {
				return line.id
			}
		}
		return ""
	},
	activeJobResponseIsClosed: () => {
		let id = this.activeJobResponse()
		if (id != "") {
			for (let i = 0; i < GetJobOrderJobResponses.data.data.getJobOrder.jobResponses.length; i++) {
				if (GetJobOrderJobResponses.data.data.getJobOrder.jobResponses[i].endDateTime != null) {
					return true
				}
			}
		}
		return false
	}

}
